import React, { useState } from 'react'

export default function HomeScreen() {
    const [count,setcount]=useState(0);
    const [counta,setcounta]=useState("");
    return (
        
        <div className="row">
            
                <button name="Add" onClick={()=>{setcount(count+1)}} >Add</button>
                <button name="Add" onClick={()=>{setcounta(counta==="Y"?"G":"Y")}} >Add !</button>
            
        {count}
        <div>{count}</div>
        <div>{counta}</div>
        </div>

    )
}
